const mystyle = {
  color: "white",
  padding: "10px",
  fontFamily: "Arial",
  textAlign : 'center'
};
const mainStyle = {
  backgroundColor : 'cyan',
  opacity : '0.8'
}
function App() {
  return (
    <div className="App" style={mainStyle}>
      <h1 style={mystyle}>Subscribe</h1>
      <h2 style={mystyle}>Sign Up with your Email address to receive news and updates.</h2>
      <Form/>
    </div>
  );
}

export default App;
